contracts/ERC20MOCK.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.22;

contract ERC20Mock {
    string public name;
    string public symbol;
    uint8 public decimals = 18;
    uint256 public totalSupply;

    mapping(address => uint256) private _balances;
    mapping(address => mapping(address => uint256)) private _allowances;

    event Transfer(address indexed from, address indexed to, uint256 value);
    event Approval(address indexed owner, address indexed spender, uint256 value);

    constructor(string memory _name, string memory _symbol, uint256 initialSupply) {
        name = _name;
        symbol = _symbol;
        _mint(msg.sender, initialSupply);
    }

    function balanceOf(address account) public view returns (uint256) {
        return _balances[account];
    }

    function transfer(address recipient, uint256 amount) public returns (bool) {
        require(recipient != address(0), "Invalid recipient");
        require(_balances[msg.sender] >= amount, "Insufficient balance");

        _balances[msg.sender] -= amount;
        _balances[recipient] += amount;
        emit Transfer(msg.sender, recipient, amount);
        return true;
    }

    function approve(address spender, uint256 amount) public returns (bool) {
        require(spender != address(0), "Invalid spender");

        _allowances[msg.sender][spender] = amount;
        emit Approval(msg.sender, spender, amount);
        return true;
    }

    function allowance(address owner, address spender) public view returns (uint256) {
        return _allowances[owner][spender];
    }

    function transferFrom(address sender, address recipient, uint256 amount) public returns (bool) {
        require(sender != address(0), "Invalid sender");
        require(recipient != address(0), "Invalid recipient");
        require(_balances[sender] >= amount, "Insufficient balance");
        require(_allowances[sender][msg.sender] >= amount, "Allowance exceeded");

        _balances[sender] -= amount;
        _balances[recipient] += amount;
        _allowances[sender][msg.sender] -= amount;
        emit Transfer(sender, recipient, amount);
        return true;
    }

    function mint(address to, uint256 amount) external {
        _mint(to, amount);
    }

    function _mint(address account, uint256 amount) internal {
        require(account != address(0), "Invalid address");
        totalSupply += amount;
        _balances[account] += amount;
        emit Transfer(address(0), account, amount);
    }
}

contracts/PRESALE.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity 0.8.22;

interface IERC20 {
    function totalSupply() external view returns (uint256);
    function balanceOf(address account) external view returns (uint256);
    function transfer(address recipient, uint256 amount) external returns (bool);
    function allowance(address owner, address spender) external view returns (uint256);
    function approve(address spender, uint256 amount) external returns (bool);
    function transferFrom(address sender, address recipient, uint256 amount) external returns (bool);

    event Transfer(address indexed from, address indexed to, uint256 value);
    event Approval(address indexed owner, address indexed spender, uint256 value);
}

library SafeERC20 {
    function safeTransfer(IERC20 token, address to, uint256 amount) internal {
        require(token.transfer(to, amount), "SafeERC20: Transfer failed");
    }

    function safeTransferFrom(IERC20 token, address from, address to, uint256 amount) internal {
        require(token.transferFrom(from, to, amount), "SafeERC20: TransferFrom failed");
    }
}

contract LaunchpadDEX {
    using SafeERC20 for IERC20;
    address public wallet;
    address public owner;

    struct Presale {
        address creator;
        address token;
        address paymentToken;
        uint256 rate;
        uint256 startTime;
        uint256 endTime;
        uint256 amountSold;
        uint256 hardCap;
        uint256 totalRaised;
        uint256 totalClaimed;
        bool completed;
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner can perform this action");
        _;
    }


    mapping(address => Presale[]) public presales;
    address[] public projects;

    event OwnershipTransferred(address indexed previousOwner, address indexed newOwner);
    event UpdateWallet(address indexed previousOwner, address indexed newOwner);
    event PresaleCreated(address indexed creator, address indexed token, uint256 rate, uint256 startTime, uint256 endTime);
    event TokenPurchased(address indexed buyer, uint256 amount);
    event TokensClaimed(address indexed claimer, uint256 amount);
    event PresaleEnded(address indexed token, uint256 index);

    constructor(){
        wallet = msg.sender;
    }

    function createPresale(
        address _token, 
        address _paymentToken, 
        uint256 _rate, 
        uint256 _startTime, 
        uint256 _endTime, 
        uint256 _hardCap
    ) external {
        require(_endTime > _startTime, "End time must be after start time");

        // Pastikan tidak ada presale lain dengan waktu yang sama untuk token ini
        Presale[] storage existingPresales = presales[_token];
        for (uint256 i = 0; i < existingPresales.length; i++) {
            require(
                !(_startTime < existingPresales[i].endTime && _endTime > existingPresales[i].startTime),
                "Overlapping presale time for this token"
            );
        }

        presales[_token].push(Presale({
            creator: msg.sender,
            token: _token,
            paymentToken: _paymentToken,
            rate: _rate,
            startTime: _startTime,
            endTime: _endTime,
            amountSold: 0,
            hardCap: _hardCap,
            totalRaised: 0,
            totalClaimed: 0,
            completed: false
        }));

        projects.push(_token);
        emit PresaleCreated(msg.sender, _token, _rate, _startTime, _endTime);
    }

    function buyToken(address _token, uint256 _amount) external {
        uint256 activeIndex = getActivePresaleIndex(_token);
        require(activeIndex != type(uint256).max, "No active presale found");

        Presale storage presale = presales[_token][activeIndex];

        require(presale.amountSold + _amount <= presale.hardCap, "Hard cap reached");

        uint256 tokensToBuy = _amount * presale.rate;
        IERC20(presale.paymentToken).safeTransferFrom(msg.sender, wallet, _amount);

        presale.amountSold += _amount;
        presale.totalRaised += _amount;

        emit TokenPurchased(msg.sender, tokensToBuy);
    }

    function claimTokens(address _token) external {
        uint256 endedIndex = getEndedPresaleIndex(_token);
        require(endedIndex != type(uint256).max, "No ended presale found");

        Presale storage presale = presales[_token][endedIndex];

        require(presale.completed, "Presale not finalized");

        uint256 amount = presale.amountSold;
        require(amount > 0, "No tokens to claim");

        presale.totalClaimed += amount;
        IERC20(_token).safeTransfer(msg.sender, amount);

        emit TokensClaimed(msg.sender, amount);
    }

    function endPresale(address _token, uint256 _index) external {
        Presale storage presale = presales[_token][_index];

        require(msg.sender == presale.creator, "Only creator can end presale");
        require(block.timestamp > presale.endTime, "Presale not ended yet");
        require(!presale.completed, "Presale already ended");

        presale.completed = true;
        emit PresaleEnded(_token, _index);
    }

    function getActivePresaleIndex(address _token) public view returns (uint256) {
        Presale[] storage allPresales = presales[_token];
        uint256 activeIndex = type(uint256).max;

        for (uint256 i = 0; i < allPresales.length; i++) {
            if (block.timestamp >= allPresales[i].startTime && block.timestamp <= allPresales[i].endTime) {
                return i; // Kembalikan index presale aktif pertama yang ditemukan
            }
        }

        return activeIndex; // Jika tidak ada presale aktif
    }

    function getEndedPresaleIndex(address _token) public view returns (uint256) {
        Presale[] storage allPresales = presales[_token];
        uint256 endedIndex = type(uint256).max;

        for (uint256 i = 0; i < allPresales.length; i++) {
            if (block.timestamp > allPresales[i].endTime && !allPresales[i].completed) {
                return i; // Kembalikan index presale pertama yang sudah selesai tapi belum diklaim
            }
        }

        return endedIndex; // Jika tidak ada presale yang sudah berakhir
    }

    function getPresaleCount(address _token) external view returns (uint256) {
        return presales[_token].length;
    }

    function getPresale(address _token, uint256 _index) external view returns (Presale memory) {
        return presales[_token][_index];
    }

    function getWallet() external view returns (address) {
        return wallet;
    }

    function setWallet(address _wallet) external onlyOwner {
        require(_wallet != address(0), "Ownable: new owner is the zero address");
        emit UpdateWallet(wallet, _wallet);
        wallet = _wallet;
    }

    function transferOwnership(address _newOwner) external onlyOwner {
        require(_newOwner != address(0), "Ownable: new owner is the zero address");
        emit OwnershipTransferred(owner, _newOwner);
        owner = _newOwner;
    }
}

